$(function () {
    function display(bool) {
        if (bool) {
            $("#container").show();
            $("#containerOut").show();
        } else {
            $("#container").hide();
            $("#containerOut").hide();
        }
    }

    display(false)

    window.addEventListener('message', function(event) {
        var item = event.data;
        if (item.type === "ui") {
            if (item.status == true) {
                display(true)
            } else {
                display(false)
            }
        }
    })
    // if the person uses the escape key, it will exit the resource
    document.onkeyup = function (data) {
        if (data.which == 27) {
            $.post('https://ic3d_vendingmachinesv2/exit', JSON.stringify({}));
            return
        }
    };
})
function beep() {
    var snd = new Audio("data:audio/mpeg;base64,_________");  
    snd.play();
}

